import React from 'react';
import JavascriptLogo from "./mainImages/JS Logo.png";
import ReactLogo from "./mainImages/React Logo.png";
import NodeLogo from "./mainImages/Node Logo.png";
import HTMLLogo from "./mainImages/HTML Logo.png";
import CSS from "./mainImages/background.png";
import mainBackground from "./mainImages/background.png";




export default function Skills() {
    return (
      <div className="Skills-Container">
        <h2 className="JavaScript">JavaScript</h2>
        <h2 className="React">React</h2>
        <h2 className="Node">Node</h2>
        <h2 className="HTML">HTML</h2>
        <h2 className="CSS">CSS</h2>
        <h2 className="Git">Git</h2>
      </div>
    );
  }
